import image from "../image.png";
import { Link, Outlet } from 'react-router-dom';

function TelaInicial(){

    return(
        <div style={{background: "#1D1D21", width:"100%", height:"100%"}}>
            <div style={{background:"#2B2B31", height:66, width: "100%"}}>
            
                <Link to="/registrarProduto" style={{borderRadius: 6, border: "solid", borderColor: "#FFC55E" ,background: "#FFC55E", textDecoration: "none", color:"black", marginLeft: "1%", fontFamily: "Bebas Neue", fontSize: 36}}>ENTRAR SEM CADASTRO</Link>
            
                <Link to="/logar" style={{borderRadius: 6, border: "solid", borderColor: "#FFC55E", background: "#FFC55E", textDecoration: "none", color:"black", fontFamily: "Bebas Neue", fontSize: 36}}>LOGIN/CADASTRO</Link>
            
                
            </div>
            <center>
                image
            <img src="../image.png"></img>
           <p style={{
            width:870,
            height:170,
            color: "#F0F0F0",
            textAlign: "center",
            fontFamily: "Bebas Neue",
            fontSize: 36
           }}
           >Você sempre quis saber quanto gasta com energia e ter um controle dos valores? Agora você pode! a partir de agora você só precisa de seguir as instruções desse maravilhoso site e logo logo você terá uma boa estimativa de quanto gasta com sua energia em casa.</p>
            </center>
        </div>
    );
}

export default TelaInicial;
